import { useState } from "react";
import Title from "./Title";
import "./App.css";

const BotHand = (numberOfCards = 5) => {
  let cards = [];
  for (let i = 0; i < numberOfCards; i++) {
    cards.push("Apple");
  }
  return cards.map((card) => <div className="BotHand">{card}</div>);
};




const GameBoard = () => {
  return (
    <div className="GameBoard">
      <BotHand />
      <CenterInfo />
      <PlayerHand />
    </div>
  );
};

const App = () => {
  return (
    <>
      <Title />
      <GameBoard />
    </>
  );
};

export default App;
